import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import {
  Navbar,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
} from "reactstrap";



function Header() {

    

  return (
    <div>
      <Navbar color="dark">
        <NavbarBrand>DDU Events</NavbarBrand>
        <Nav className="me-auto" navbar>
          <NavItem>
            <NavLink href="/CreatePost">CreatePost</NavLink>
          </NavItem>
        </Nav>
      </Navbar>
    </div>
  );
}

export default Header;
